import { CHANGE_CARD_INFO } from './cardInfo-constant.js';

const initialState = {
	card_info: [],
}

const change_cardinfo_reducer = (state=initialState, action) => {
	switch(action.type) {
		case CHANGE_CARD_INFO:
			return Object.assign({}, state, {card_info: action.payload.card_info});
		default:
			return state
	}
}

export default change_cardinfo_reducer;
